"use strict";const preloader=document.querySelector(".preloader");if(preloader){let e=0,t=document.querySelectorAll(".preloader__img"),s;function initSlideshow(){setImage(0),s=setInterval(function(){nextImage()},200)}function nextImage(){t.length===e+1?e=0:e++,setImage(e)}function setImage(e){t.forEach(e=>e.classList.remove("active")),t[e].classList.add("active")}initSlideshow(),sessionStorage.getItem("showPreloader")?setTimeout(function(){preloader.classList.add("hide"),clearInterval(s)},500):(sessionStorage.setItem("showPreloader","true"),setTimeout(function(){preloader.classList.add("hide"),clearInterval(s)},2e3))}